import './PageCours.scss';
import ListeSessions from './ListeSessions';
import useFetch from '../Hooks/useFetch';

export default function PageCours(props){

    const sessions = useFetch('http://localhost:8080/projet-web-5w5/index.php/wp-json/wp/v2/session');

    return (
        <main className="PageCours">
            (sessions != null) 
                ?
                <ListeSessions key={sessions.titre} sessions={sessions}/>
                :
                <p>Loading</p>

        </main>
    );
}
